'''Fathimath Shafeega''' ([[Dhivehi]]: &#1930;&#1959;&#1932;&#1960;&#1929;&#1958;&#1932;&#1968;
&#1949;&#1958;&#1930;&#1961;&#1934;&#1959;) ('''b.''' [[November 4]], [[1968]]), commonly known as '''Shafeega''', is famous in the Maldivian financial sector as the founder of the Maldivian Stock Market, The Maldives Stock Exchange.

==Early and personal life==
Shafeega was born in [[Malé]], [[Maldives]].

