'''Fathimath Shafeega''' ([[Dhivehi]]: ފާތިމަތް ޝަފީގާ) ('''b.''' [[September 21]], [[1968]]), commonly known as '''Shafeega''', is the Cheif Executive Officer of the Capital Market Development Authority in the Maldives, she has pioneered the Stock Exchange and Depository in the Maldives. ==Education== Shafeega recieved her secondary school education in Aminiya School, Male', Maldivesand later was recieved her masters from Monash University, Melbourne, Australia. ==Early and personal life== Shafeega was born in [[G.A.Kolamaafushi]], [[Maldives]] but has lived in Male' from a realatively small age. She is the eldest child of Aiminath Fareeda and Ibrahim Thaufeeg. She persently lives in Male' with her husband Abdulla Saeed and her two daughters Mariyam Shawadhin Abdulla and Aishath Isra Abdulla. She has nine other siblings
